'''Mist''' forms while fighting [[vampyre juvinate]]s, when their health approaches 0. Without the use of the [[Special attacks|special attack]] of either the [[Rod of ivandis|Rod of Ivandis]], [[Ivandis flail]] or [[Blisterwood flail]] and a dose of [[Guthix balance]] to finish them, vampyres turn into mist and escape to rejuvenate.

